import React, { useState } from "react";
import styles from "../css/Home.module.css";
import Card from "../components/Card";
import Login from "../components/Login";
import ShortCut from "../components/ShortCut";
import GenerateCsv from "../components/GenerateCsv";
import RandomKeyword from "../components/RandomKeyword";
import CommingSoon from "../components/CommingSoon";

const Home = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const totalCard = [
    { id: 1, title: "login", children: <Login /> },
    { id: 2, title: "shortcut-website", children: <ShortCut /> },
    { id: 3, title: "generate-csv", children: <GenerateCsv /> },
    { id: 4, title: "generate-random-keyword", children: <RandomKeyword /> },
    { id: 5, title: "comming-soon", children: <CommingSoon /> },
    { id: 6, title: "comming-soon", children: <CommingSoon /> },
    { id: 7, title: "comming-soon", children: <CommingSoon /> },
    { id: 8, title: "comming-soon", children: <CommingSoon /> },
    { id: 9, title: "comming-soon", children: <CommingSoon /> },
  ];

  return (
    <div className={styles.cardSection}>
      {totalCard.map((item, idx) => (
        <Card
          key={idx}
          id={item.title}
          className={!isLoggedIn && item.id !== 1 ? styles.blurred : ""}
        >
          {item.children}
        </Card>
      ))}
    </div>
  );
};

export default Home;
